    amount: 245,
    date: new Date(2020, 7, 14),
  },
  {
    id: 'e2',
    title: 'Sachet Paper',
    amount: 845,
    date: new Date(2020, 7, 14),
  },
  {
    id: 'e3',
    title: 'New Paper',
    amount: 765,
    date: new Date(2020, 7, 14),
  },
  {
    id: 'e4',
    title: 'Old Paper',
    amount: 900,
    date: new Date(2020, 7, 14),
  }
  ]

  return (
    <div className="App">
      <ExpenseItems
      date={expenses[0].date}
      amount={expenses[0].amount}
      title={expenses[0].title}>
      </ExpenseItems>
